// HasRule applies the HasEdge predicate on the "rule" edge.
func HasRule() predicate.IncidentRuleExecution {
	return predicate.IncidentRuleExecution(func(s *sql.Selector) {
		step := sqlgraph.NewStep(
			sqlgraph.From(Table, FieldID),
			sqlgraph.Edge(sqlgraph.M2O, true, RuleTable, RuleColumn),
		)
		sqlgraph.HasNeighbors(s, step)
	})
}

// HasRuleWith applies the HasEdge predicate on the "rule" edge with a given conditions (other predicates).
func HasRuleWith(preds ...predicate.IncidentRule) predicate.IncidentRuleExecution {
	return predicate.IncidentRuleExecution(func(s *sql.Selector) {
		step := newRuleStep()
		sqlgraph.HasNeighborsWith(s, step, func(s *sql.Selector) {
			for _, p := range preds {
				p(s)
			}
		})
	})
}

// And groups predicates with the AND operator between them.
func And(predicates ...predicate.IncidentRuleExecution) predicate.IncidentRuleExecution {
	return predicate.IncidentRuleExecution(sql.AndPredicates(predicates...))
}

// Or groups predicates with the OR operator between them.
func Or(predicates ...predicate.IncidentRuleExecution) predicate.IncidentRuleExecution {
	return predicate.IncidentRuleExecution(sql.OrPredicates(predicates...))
}

// Not applies the not operator on the given predicate.
func Not(p predicate.IncidentRuleExecution) predicate.IncidentRuleExecution {
	return predicate.IncidentRuleExecution(sql.NotPredicates(p))
}
